(404, 1, '2016-02-15 15:30:56', '2016-02-15 20:30:56', '<h4>We are collectively the girl from NYC</h4>\nTheir efforts are lit by a single lamp strategically placed on the makeshift stage at the back wall of the house. After a little searching, we find the other heads from the neighborhoodâwho came to the gig in two carloadsâin the far corner of the yard with a keg between them. but we are by no means alone in the backyard. Kids from Montebello, Huntington Park, Highland Park, South Gate, Alhambra, El Sereno, Monterey Park, and other areas have also come out tonight to see the Sex Pistols, who are rumored to be making a rare appearance. I make my way through the crowd, can of Bud in hand, place my very scrawny self squarely in front of the stage, and begin heckling the members of Side Effects, who are friends from Whittier.\n\nâYou guys are too stupid to play and your drummer is a gimp,â I shout at them through the din of tuning instruments. Behind me, another critic chimes in with âGo back to Whittier you has-been scumbags.â\n\nTheir singer smiles. âGlad to see you guys, too,â he deadpans into the microphone. Their drummer four-clicks and, as the band begins their first song, the backyard erupts into the sea of ritualized violence we call dancing. Their singer smiles.', 'Etsy Shabby Fingerstache 2015', '', 'future', 'closed', 'closed', '', 'dj-set-with-akumba', '', '', '2016-02-15 15:30:56', '2016-02-15 20:30:56', '', 0, 'http://irontemplates.com/wp-themes/ironband/?post_type=gig&#038;p=165', 0, 'event', '', 0),
