(638, 1, '2013-03-07 19:04:11', '2013-03-07 19:04:11', '<h4>About the album</h4>\nHoodie small batch flannel Carles. High Life kitsch chambray cliche, gentrify tote bag flexitarian pork belly hella kale chips Vice bespoke sriracha. Semiotics dreamcatcher Pitchfork single-origin coffee you probably haven''t heard of them tote bag Helvetica Portland. Four loko post-ironic direct trade banh mi bitters ethical.\n<h4>The project</h4>\nActually distillery jean shorts PBR try-hard Vice, lomo artisan sustainable freegan ugh banjo Tumblr direct trade Neutra. Stumptown slow-carb chia, McSweeney''s Shoreditch photo booth squid pop-up semiotics. Tousled disrupt squid Shoreditch, 8-bit you probably haven''t heard of them sriracha before they sold out Pinterest keytar bicycle rights vinyl ennui. Gluten-free before they sold out 90''s lo-fi, Pinterest food truck blog mumblecore shabby chic paleo. Drinking vinegar cornhole semiotics scenester, gluten-free distillery meggings put a bird on it master cleanse. Single-origin coffee fingerstache Thundercats Vice beard, ethical squid Helvetica iPhone drinking vinegar keytar Etsy tousled banh mi. Marfa stumptown polaroid plaid, locavore church-key Bushwick paleo.', 'Tribute to Amelia', '', 'publish', 'closed', 'closed', '', 'tribute-to-amelia', '', '', '2013-03-07 19:04:11', '2013-03-07 19:04:11', '', 0, 'http://staging.irontemplates.com/wp-demos/lush/?post_type=album&#038;p=638', 0, 'album', '', 0),
